import React from 'react'
import {withCharacter} from './MyProvider'

function SingleSpell(props){
    const {spell, type, effect} = props

    return(
        <div>
            <h2>{spell}</h2>
            <h4>{type}</h4>
            <h5>{effect}</h5>
        </div>
    )
}

export default withCharacter(SingleSpell)
